import React from 'react';
import Grid from "@material-ui/core/Grid";
import makeStyles from "@material-ui/core/styles/makeStyles";
import HobbyCard from "./HobbyCard";

import cube from "../images/Hobbies/Cubing_DP.jpg";
import piano from "../images/Hobbies/Piano_DP.jpg";
import guitar from "../images/Hobbies/Guitar_DP.jpg";
import badminton from "../images/Hobbies/Badminton_DP.jpg";
import trekking from "../images/Hobbies/Trekking_DP.jpg";
import running from "../images/Hobbies/Running_DP.jpg";
import Speedcubing from "./Hobbies/Speedcubing";

const DP_side = 355;

const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1
    },
    grid: {
        marginTop: 20,
        marginBottom: 20,
        // marginLeft: 10,
    }
}))

const hobby_description = [
    {
        title: "Speedcubing",
        image: cube,
        content: <Speedcubing/>
    },
    {
        title: "Guitar",
        image: guitar,
        content: 1
    },
    {
        title: "Piano",
        image: piano,
        content: 2
    },
    {
        title: "Badminton",
        image: badminton,
        content: 3
    },
    {
        title: "Trekking",
        image: trekking,
        content: 4
    },
    {
        title: "Running",
        image: running,
        content: 5
    },
];

export default function HobbiesPage() {
    const classes = useStyles();
    const gridSize = 3;

    return (
        <div>
            {[...Array(2)].map((a, row) =>
                <Grid container spacing={2} className={classes.grid}>
                    {[...Array(3)].map((b, col) => {
                        let index = 3*row + col;
                        let hobby = hobby_description[index];
                        return (
                            <Grid item xs={{gridSize}}>
                                <HobbyCard {...hobby}/>
                            </Grid>
                        );
                    })}
                </Grid>
            )}
        </div>
    );
}
